function writeUserData(first_name, last_name, id, time_start, time_end) {
    firebase.database().ref("users/" + id).set({
    id: id,
    first_name: first_name,
    last_name: last_name,
    time_start: time_start,
    time_end: time_end,
  });
}

export default writeUserData;
